})


export default function CardReview (props) {
    const classes = useStyles();
    const {  children } = props;
    return(
        <>
            <li className={classes.reviewsItem}>
                <article className={classes.revCard}>
                    <div className={classes.revCardContent}>
                        {children} 
                    </div>
                </article>
            </li>
        </>
    )
}
